I am Nabila Parijat. I am a third year PhD student in the Public and Nonprofit Management Program the University of Texas at Dallas (UTD). My research interests include program evaluation, performance measurement and immigration. Currently, I am studying the labor market effects of high-skilled immigration to the United States (US) through the H1B program. I am concurrently submitting and presenting research in conferences relating to the effectiveness of US-funded programs in food assistance and foreign aid.


Please view my Resume to know further about me. I am interested in research-related positions in both academia, local and international nonprofits, and thinktanks.
